import './Rodape.css'
import Link from "@material-ui/core/Link";
import { FaInstagram } from "react-icons/fa";
import { CiLinkedin } from "react-icons/ci";
import { AiFillGithub } from "react-icons/ai";


function Rodape() {
    return (
        <footer className='footer'>
            <ul>
                
                <Link
                    href="https://www.instagram.com/marinheiroz"
                    onClick={() => {
                    alert("Redirecting to Instagram");
                    }}
                >
                    <li><FaInstagram /></li>
                </Link>
                <Link
                    href="https://www.linkedin.com/in/vitor-marinheiro-590a461ba/"
                    onClick={() => {
                    alert("Redirecting to Linkedin");
                    }}
                >
                    <li><CiLinkedin /></li>
                </Link>
                <Link
                    href="https://www.linkedin.com/in/vitor-marinheiro-590a461ba/"
                    onClick={() => {
                    alert("Redirecting to GitHub");
                    }}
                >
                    <li><AiFillGithub /></li>
                </Link>
            </ul>
            <p>Desenvolvido por Vitor Marinheiro.</p>
        </footer>
    )
}

export default Rodape
